"PayPal Credit for WordPress\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:8;a:5:{s:4:\"data\";s:13:\"WP e-Commerce\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:9;a:5:{s:4:\"data\";s:12:\"WP eCommerce\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:33:\"https://wpecommerce.org/?p=481727\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:415:\"WP eCommerce 3.12.2 has officially been released! This release includes a particularly nice feature that makes it super simple for users to now use PayPal Credit when using the PayPal Express Checkout gateway. We’re excited...</p><p class=\"continue-reading\"><a class=\"more-link\" href=\"https://wpecommerce.org/news/wp-ecommerce-partners-with-paypal-to-make-purchasing-even-easier/\">Continue reading &#8594;</a></p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"Lizz\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:1007:\"<p>WP eCommerce 3.12.2 has officially been released! This release includes a particularly nice feature that makes it super simple for users to now use PayPal Credit when using the PayPal Express Checkout gateway.</p>\n<p>We’re excited to partner with PayPal and offer this feature through WP eCommerce. We’re long-time fans of PayPal, and we know that making such a popular platform even easier to use on your WordPress sites will make your customers happy, too!</p>\n<p>If you aren’t familiar with PayPal Credit, check out these resources:</p>\n<ul>\n<li><a href=\"https://www.paypal.com/us/webapps/mpp/paypal-credit\">About PayPal Credit</a></li>\n<li><a href=\"https://www.paypal.com/us/webapps/mpp/paypal-credit/how-it-works\">How PayPal Credit works</a></li>\n<li><a href=\"https://www.paypal.com/us/webapps/mpp/paypal-credit/faq\">PayPal Credit FAQ</a></li>\n</ul>\n<p>Check out <a href=\"https://wpecommerce.org\">WP eCommerce 3.12.2</a> and make it even easier for your customers to purchase your goods.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:99:\"https://wpecommerce.org/news/wp-ecommerce-partners-with-paypal-to-make-purchasing-even-easier/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"0\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:1;a:6:{s:4:\"data\";s:42:\"\n		\n		\n		\n		\n		\n				\n\n		\n		\n				\n			\n		\n		\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:20:\"WP eCommerce Support\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:50:\"https://wpecommerce.org/news/wp-ecommerce-support/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:59:\"https://wpecommerce.org/news/wp-ecommerce-support/#comments\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 24 Apr 2017 15:53:13 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"News\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:33:\"https://wpecommerce.org/?p=481715\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:362:\"We’re making some changes to WP eCommerce Support! As always, users that only use the WP eCommerce core plugin, support will be provided via the WordPress.org forums. &#160; For users that have purchased an add-on,...</p><p class=\"continue-reading\"><a class=\"more-link\" href=\"https://wpecommerce.org/news/wp-ecommerce-support/\">Continue reading &#8594;</a></p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:15:\"Mihai Alexandru\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:2280:\"<p><span style=\"font-weight: 400;\">We’re making some changes to WP eCommerce Support!</span></p>\n<p><span style=\"font-weight: 400;\">As always, users that only use the WP eCommerce core plugin, support will be provided via the <a href=\"https://wordpress.org/support/plugin/wp-e-commerce\" target=\"_blank\" rel=\"noopener noreferrer\">WordPress.org forums</a>.</span></p>\n<p>&nbsp;</p>\n<p><span style=\"font-weight: 400;\">For users that have purchased an add-on, support for the purchased extension is available at </span><a href=\"https://wpecommerce.org/support/\" target=\"_blank\" rel=\"noopener noreferrer\"><span style=\"font-weight: 400;\">https://wpecommerce.org/support/</span></a><span style=\"font-weight: 400;\">. All you have to do is fill in the information required on the page, and make sure to use the email address you used to purchase the add-on as well. You will also need to provide your license key! An active license key is required to be able to submit the form and receive support, and also select the add-on that you are having trouble with.</span></p>\n<p>&nbsp;</p>\n<p><span style=\"font-weight: 400;\">For those of you that want to receive Premium Support for the core plugin and also any of our addons, then we have good news: </span></p>\n<p>&nbsp;</p>\n<p><span style=\"font-weight: 400;\">We are introducing a <strong>Premium Support membership</strong>! You can find the details here </span><span style=\"font-weight: 400;\"><a href=\"https://wpecommerce.org/premium-support-pricing/\" target=\"_blank\" rel=\"noopener noreferrer\">https://wpecommerce.org/premium-support-pricing/</a>.</span></p>\n<p>&nbsp;</p>\n<p><span style=\"font-weight: 400;\">Users that have an active membership for Premium Support can request support on the same support page </span><span style=\"font-weight: 400;\"><a href=\"https://wpecommerce.org/support/\">https://wpecommerce.org/support/</a> </span><span style=\"font-weight: 400;\">without the need of an active license key, as well as to request support for any of our addons that you are using (and of course, the core plugin, too).</span></p>\n<p><span style=\"font-weight: 400;\">Plus when you are logged in on our website you can request support via chat when any of our staff is available and if you have an active support membership.</span></p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:55:\"https://wpecommerce.org/news/wp-ecommerce-support/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"1\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:2;a:6:{s:4:\"data\";s:63:\"\n		\n		\n		\n		\n		\n				\n		\n		\n		\n		\n		\n		\n		\n\n		\n		\n				\n			\n		\n		\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:35:\"Introducing Square for WP eCommerce\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:65:\"https://wpecommerce.org/news/introducing-square-for-wp-ecommerce/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:74:\"https://wpecommerce.org/news/introducing-square-for-wp-ecommerce/#comments\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 22 Feb 2017 22:29:22 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:8:{i:0;a:5:{s:4:\"data\";s:4:\"News\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:16:\"Payment Gateways\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:2;a:5:{s:4:\"data\";s:7:\"Plugins\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:3;a:5:{s:4:\"data\";s:8:\"releases\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:4;a:5:{s:4:\"data\";s:6:\"square\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:5;a:5:{s:4:\"data\";s:23:\"square for WP eCommerce\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:6;a:5:{s:4:\"data\";s:9:\"WordPress\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:7;a:5:{s:4:\"data\";s:12:\"WP eCommerce\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:33:\"https://wpecommerce.org/?p=481566\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:391:\"Square has changed the way so many merchants do business. According to a Mashable article from 2013, there are over three million users and 250,000 merchants and presumably the time that has passed since the article was written...</p><p class=\"continue-reading\"><a class=\"more-link\" href=\"https://wpecommerce.org/news/introducing-square-for-wp-ecommerce/\">Continue reading &#8594;</a></p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:15:\"Mihai Alexandru\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:1689:\"<h1>Square has changed the way so many merchants do business.</h1>\n<p>According to a <a href=\"http://mashable.com/2013/02/17/square-jobs/#nu57SxHZWgqB\">Mashable</a> article from 2013, there are over three million users and 250,000 merchants and presumably the time that has passed since the article was written has led to even <em>higher</em> numbers.</p>\n<p>WP eCommerce is a popular WordPress plugin with over 40,000 active installs, but prior to today, folks who were using Square couldn&#8217;t accept payments through their WP eCommerce-powered store.</p>\n<p>Now, we&#8217;re changing the game.</p>\n<p>At the request of our audience, we&#8217;re introducing a new product:</p>\n<h3><a href=\"https://wpecommerce.org/store/product/square-payments/\">Square for WP eCommerce</a></h3>\n<ul>\n<li><strong>Accept every payment, everywhere</strong><br />\nThe new Square Reader lets you dip EMV chip cards and accept NFC payments like Apple Pay. You can also swipe magnetic-stripe cards with the included magstripe reader.</li>\n<li><strong>Fast deposits, clear pricing</strong><br />\nPay 2.65% per swipe for Visa, Mastercard, Discover and American Express. See deposits in your bank account in one to two business days.</li>\n</ul>\n<p>With the Square extensions you can accept payments on your WP eCommerce powered store from your customers.</p>\n<p>This is only the initial release! More will be added in future updates, including features like inventory, product sync between Square and WP eCommerce, and more.</p>\n<p>Download it, give it a try, and let us know what you think!</p>\n<p><em>Square eCommerce payments is only available in the U.S, Canada and Australia</em></p>\n<p>&nbsp;</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:70:\"https://wpecommerce.org/news/introducing-square-for-wp-ecommerce/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"2\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:3;a:6:{s:4:\"data\";s:42:\"\n		\n		\n		\n		\n		\n				\n\n		\n		\n				\n			\n		\n		\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:19:\"WP eCommerce 3.12.0\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:49:\"https://wpecommerce.org/news/wp-ecommerce-3-12-0/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:58:\"https://wpecommerce.org/news/wp-ecommerce-3-12-0/#comments\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 17 Feb 2017 23:25:47 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"News\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:33:\"https://wpecommerce.org/?p=481581\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:384:\"We&#8217;re pleased to announce the release of WP eCommerce 3.12.0! If you&#8217;ve been beta testing our new theme engine, you&#8217;ll see loads of improvements to that, which we&#8217;re incredibly excited about.  The theme engine will...</p><p class=\"continue-reading\"><a class=\"more-link\" href=\"https://wpecommerce.org/news/wp-ecommerce-3-12-0/\">Continue reading &#8594;</a></p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Justin Sainton\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:1931:\"<p>We&#8217;re pleased to announce the release of WP eCommerce 3.12.0!</p>\n<p>If you&#8217;ve been beta testing our new theme engine, you&#8217;ll see loads of improvements to that, which we&#8217;re incredibly excited about.  The theme engine will launch with our upcoming 4.0 release, but it&#8217;s <a href=\"https://gist.github.com/JustinSainton/4d8f1a37b412efdfe0d745129b470c33\">quite simple to enable by default</a>. It has come along way, and we can&#8217;t wait for you to see it.</p>\n<p>Along with the theme engine improvements, we&#8217;re <em>incredibly excited </em>to announce a brand-new core payment gateway: <strong>ProPay (a TSYS company)</strong>. They&#8217;re a leading innovator in the payment gateway space in the United States, and we&#8217;re elated that they&#8217;ve become a key partner in WPEC&#8217;s future growth.  If you are a US-based shop, we <em>highly </em>recommend <a href=\"https://www.propay.com/?refid=WPECOMM\">creating an account with them</a> &#8211; we think you&#8217;ll see increased conversions, decreased PCI-compliance costs, and improved customer experiences.</p>\n<p>In addition to the myriad theme engine improvements, we&#8217;ve also made several awesome enhancements:</p>\n<p>* Fix: When updating a pending order, ensure that the order object&#8217;s total price is updated as well.<br />\n* Fix: Update admin.js to not use deprecated size() method.<br />\n* Fix: Currency code was incorrectly cached.<br />\n* Fix: Express Checkout 3.0 JavaScript now properly enqueued.<br />\n* Enhancement: <a href=\"http://docs.wpecommerce.org/creating-a-payment-gateway/\">Payment Gateway API</a> now fully supports Auth/Capture workflows, in addition to refunds and partial refunds introduced in 3.11.5.</p>\n<p>We hope you enjoy using our latest release as much as we enjoyed developing it! <a href=\"https://wordpress.org/plugins/wp-e-commerce/\">Download it at WordPress.org</a> today!</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:54:\"https://wpecommerce.org/news/wp-ecommerce-3-12-0/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"2\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:4;a:6:{s:4:\"data\";s:42:\"\n		\n		\n		\n		\n		\n				\n\n		\n		\n				\n			\n		\n		\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:36:\"WP eCommerce 3.11.4: Security Update\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:65:\"https://wpecommerce.org/news/wp-ecommerce-3-11-4-security-update/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:74:\"https://wpecommerce.org/news/wp-ecommerce-3-11-4-security-update/#comments\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Sat, 12 Nov 2016 18:14:10 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"News\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:33:\"https://wpecommerce.org/?p=480222\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:417:\"We&#8217;ve just released WP eCommerce 3.11.4.  This is a highly recommended update. We were notified of a security vulnerability &#8211; a SQL injection vulnerability. It was responsibly disclosed by the plugins team at WordPress.org &#8211; we&#8217;re...</p><p class=\"continue-reading\"><a class=\"more-link\" href=\"https://wpecommerce.org/news/wp-ecommerce-3-11-4-security-update/\">Continue reading &#8594;</a></p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Justin Sainton\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:892:\"<p>We&#8217;ve just released WP eCommerce 3.11.4.  This is a <em>highly recommended update.</em></p>\n<p>We were notified of a security vulnerability &#8211; a SQL injection vulnerability. It was responsibly disclosed by the plugins team at WordPress.org &#8211; we&#8217;re grateful for their disclosure and discretion.  We were notified yesterday, patched on GitHub within an hour of being notified, and pushed a release to WordPress.org this morning.</p>\n<p>This vulnerability only affects users who use eWay as their payment gateway, have Gold Cart activated, and are using the as-of-yet-unreleased Theme Engine 2.0.  We believe the number of users affected is likely close to zero, due to these conditions &#8211; but still, we highly recommend updating.</p>\n<p>Thanks again to our wonderful user community, our developer team, and the great folks at WordPress.org (thanks Mika!)</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:70:\"https://wpecommerce.org/news/wp-ecommerce-3-11-4-security-update/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"8\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:5;a:6:{s:4:\"data\";s:42:\"\n		\n		\n		\n		\n		\n				\n\n		\n		\n				\n			\n		\n		\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:36:\"Changes in Product Licensing/Support\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:57:\"https://wpecommerce.org/news/changes-in-products-support/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:66:\"https://wpecommerce.org/news/changes-in-products-support/#comments\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 06 Nov 2015 02:48:51 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"News\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:33:\"https://wpecommerce.org/?p=479881\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:358:\"As of today, we have implemented a new licensing system. Since the new licensing system has been enabled, old API Keys are no longer compatible with the new licenses. We recognize this is an inconvenience....</p><p class=\"continue-reading\"><a class=\"more-link\" href=\"https://wpecommerce.org/news/changes-in-products-support/\">Continue reading &#8594;</a></p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:15:\"Mihai Alexandru\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:3644:\"<p>As of today, we have implemented a new licensing system. Since the new licensing system has been enabled, old API Keys are no longer compatible with the new licenses. We recognize this is an inconvenience. However, we will do our best to make sure you still have access to past download files and access to our support system.</p>\n<p>&nbsp;</p>\n<p><em>What Has Changed?</em></p>\n<p>The new support system no longer requires what was known as a Support Token and will only validate the license. All new licenses are valid for 1 year from the time of purchase. In that time you get unrestricted access to support and to plugin updates. Old API keys that are expired (over 1 year old since purchase) can no longer be used and for that reason we will offer you a coupon so that you can purchase a new license key at a discounted price.</p>\n<p>From now on if you require Premium Support you can do that by going to the <a href=\"https://wpecommerce.org/store/your-account/\" target=\"_blank\">Your Account</a> page and using the Support tab. You will need to enter your License key when creating a new support request which will be validated. If it fits in the 1 Year free support time frame since the date of purchase then your support request will be sent to us.</p>\n<p>Also on the user account page you will be able to view all your current licenses and their status and expiration date. Each product (built by WP eCommerce) purchased from our website will receive 1 License key which you will need to post new support requests.</p>\n<p>&nbsp;</p>\n<p><em>Gold Cart and other plugins</em></p>\n<p>Until now we required users to enter an API Key and Name to register Gold Cart&#8217;s premium functions on your store. With the release of 2.9.10 for Gold Cart the features are enabled as soon as you activate the plugin.</p>\n<p>For the rest of the plugins which are made by WP eCommerce they will provide a License key during purchase which you can use for support and to receive plugin updates.</p>\n<p>&nbsp;</p>\n<p><em>WP eCommerce 3.11 changes. </em></p>\n<p>Under Dashboard we had a page called Store Upgrades. We have renamed that page to WPeC Licensing.</p>\n<p>This new page will only show a box where you can enter your License and register or reset it from the current URL. Once you register the license for each product that offers one you will receive automatic plugin updates via the Plugins page. Each license validates against the plugin it was generated for. For example you will not receive plugin updates for Plugin X if you registered on the WPeC Licensing page a license for Plugin Y. Each plugin checks for its own license and show updates if available.</p>\n<p>You will also be able to see some information about the License like Expiration date and product its linked for just like in the <a href=\"https://wpecommerce.org/store/your-account/\" target=\"_blank\">User Account</a> page on our website.</p>\n<p>&nbsp;</p>\n<p><em>What about old API Key users ?</em></p>\n<p>We have built a page on which you will be able to verify your current API status. <a href=\"https://wpecommerce.org/deprecating-api-keys/\" target=\"_blank\">Click Here</a></p>\n<p>If your API Key fits in the 1 Year since purchase it will allow you to download the latest Gold Cart version on that page and also you CAN use it to post Premium Support requests until its valid period is up. Since they are not compatible with the new Licenses after expiration you will have to purchase a product to receive a brand new License.</p>\n<p>If your API Key is expired already you will receive a coupon code for a discount in the purchase of a new product from our website.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:62:\"https://wpecommerce.org/news/changes-in-products-support/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:2:\"36\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:6;a:6:{s:4:\"data\";s:45:\"\n		\n		\n		\n		\n		\n				\n		\n\n		\n		\n				\n			\n		\n		\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:16:\"Gold Cart 2.9.10\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:46:\"https://wpecommerce.org/news/gold-cart-2-9-10/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:55:\"https://wpecommerce.org/news/gold-cart-2-9-10/#comments\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 06 Nov 2015 02:46:52 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:2:{i:0;a:5:{s:4:\"data\";s:9:\"Gold Cart\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:4:\"News\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:33:\"https://wpecommerce.org/?p=479880\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:353:\"Gold Cart version 2.9.10 is now available for download on Your Account page if you have an existing account. With this version and the introduction of License keys that replace our old API Key system Gold Cart...</p><p class=\"continue-reading\"><a class=\"more-link\" href=\"https://wpecommerce.org/news/gold-cart-2-9-10/\">Continue reading &#8594;</a></p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:15:\"Mihai Alexandru\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:1120:\"<p>Gold Cart version 2.9.10 is now available for download on <a href=\"https://wpecommerce.org/store/your-account/\">Your Account</a> page if you have an existing account.</p>\n<p>With this version and the introduction of License keys that replace our old API Key system Gold Cart will be &#8220;registered&#8221; as soon as you activate it and if you do choose to enter your License key on your website under the WPeC Licensing menu it will allow you to receive automatic plugin updates via the Plugins menu as long as the License is not expired and not suspended.</p>\n<p>&nbsp;</p>\n<p>Below is the change log for the 2.9.10 version:</p>\n<pre>= 2.9.10 =\r\n* Feature: Automatic plugin updates now available only with License keys. Product License must be registered on your website under Dashobard -&gt; WPeC Licensing menu.\r\n* Update: SagePay now supports Authenticate payment type\r\n* Update: Compatibility with WordPress 4.3\r\n* Fixed: Some grid view forced styles have been removed\r\n* Update: PayFlow Pro Card CVV length now accepts 4 characters\r\n* Update: Authorize.net Endpoints and Security Certificate Updates</pre>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:51:\"https://wpecommerce.org/news/gold-cart-2-9-10/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"6\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:7;a:6:{s:4:\"data\";s:45:\"\n		\n		\n		\n		\n		\n				\n		\n\n		\n		\n				\n			\n		\n		\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:55:\"WP eCommerce and the latest PayPal SHA 256 Announcement\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:85:\"https://wpecommerce.org/news/wp-ecommerce-and-the-latest-paypal-sha-256-announcement/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:93:\"https://wpecommerce.org/news/wp-ecommerce-and-the-latest-paypal-sha-256-announcement/#respond\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 17 Sep 2015 21:10:25 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:2:{i:0;a:5:{s:4:\"data\";s:10:\"Developers\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:4:\"News\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:33:\"https://wpecommerce.org/?p=479899\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:393:\"PayPal announced on it’s developer website, as well as via an email sent to all PayPal business customers who’ve used the PayPal IPN within the last year that it is moving to a new SSL certificate type for...</p><p class=\"continue-reading\"><a class=\"more-link\" href=\"https://wpecommerce.org/news/wp-ecommerce-and-the-latest-paypal-sha-256-announcement/\">Continue reading &#8594;</a></p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:6:\"Edward\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:1452:\"<p><a href=\"https://devblog.paypal.com/paypal-ssl-certificate-changes/\">PayPal announced</a> on it’s developer website, as well as via an email sent to all PayPal business customers who’ve used the PayPal IPN within the last year that it is moving to a new SSL certificate type for all of it’s API endpoints that use a bundled certificate.</p>\n<p><strong>WP eCommerce, and our official extensions, are 100% compatible with the changes, and will not require an update of any kind.</strong></p>\n<p>For your information we feel it&#8217;s important to provide additional information that may help.</p>\n<ul>\n<li>By and large this is a server related issue.</li>\n<li>Here is <a href=\"https://www.paypal-techsupport.com/ci/fattach/get/487025/1429638687/redirect/1/filename/2015%20Merchant%20Security%20System%20Upgrade%20Guide%20%28U.S.%20English%29.pdf\">PayPal&#8217;s official documentation on the topic</a>.</li>\n<li>You can check your SSL by copying and pasting the certificate or CSR file into <a href=\"https://certlogik.com/decoder/\" target=\"_blank\">https://certlogik.com/decoder/</a> this will give you many details about the security level of your SSL.</li>\n<li>If your server is running <strong>cPanel 11.46 or newer</strong> SHA-256 has been the default. Any SSLs you have generatd within the last year or so would be compliant.</li>\n<li>We strongly urge you to consult your hosting provider for additional information.</li>\n</ul>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:90:\"https://wpecommerce.org/news/wp-ecommerce-and-the-latest-paypal-sha-256-announcement/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"0\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:8;a:6:{s:4:\"data\";s:51:\"\n		\n		\n		\n		\n		\n				\n		\n		\n		\n\n		\n		\n				\n			\n		\n		\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:23:\"WP eCommerce 4.0 Beta 1\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:53:\"https://wpecommerce.org/news/wp-ecommerce-4-0-beta-1/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:62:\"https://wpecommerce.org/news/wp-ecommerce-4-0-beta-1/#comments\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 01 Jul 2015 21:04:35 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:4:{i:0;a:5:{s:4:\"data\";s:15:\"GetShopped News\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:4:\"News\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:2;a:5:{s:4:\"data\";s:8:\"releases\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:3;a:5:{s:4:\"data\";s:19:\"WP eCommerce Plugin\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:33:\"https://wpecommerce.org/?p=479735\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:366:\"The 4.o release of WP eCommerce is quickly approaching! We&#8217;re now in our beta period, and we&#8217;re taking this opportunity to share with you about all of the major changes that are occurring in this release....</p><p class=\"continue-reading\"><a class=\"more-link\" href=\"https://wpecommerce.org/news/wp-ecommerce-4-0-beta-1/\">Continue reading &#8594;</a></p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Justin Sainton\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:5889:\"<p>The 4.o release of WP eCommerce is quickly approaching! We&#8217;re now in our beta period, and we&#8217;re taking this opportunity to share with you about all of the major changes that are occurring in this release. We&#8217;ll likely have 2-3 beta releases and 1-2 release candidates before we launch 4.0.</p>\n<p>There&#8217;s something for everything, and some parts of this release have been in active development for over two years!  It&#8217;s the last of our monolithic releases, and it is going to position us to move forward with more regular major releases, which we&#8217;re ecstatic about.</p>\n<p>Without any further adieu, here&#8217;s an outline of some of the major changes to this release, along with specific areas to test in each area.</p>\n<h2>New Theme Engine</h2>\n<p><em>By far </em>the largest, most revolutionary change in the 4.0 release, we finally have an updated, modernized theme engine in WP eCommerce.  It has taken literally thousands of man hours, being in development since 2013, exclusively by core contributors to WordPress &#8211; so you know it&#8217;s good.  Built on an MVC approach at the development level, filled with helpful actions and filters, and crafted from the ground up according to the best usability research available &#8211; there isn&#8217;t a better default theme engine in the market today.  We&#8217;re incredibly proud of the work done here and can&#8217;t wait for you to try it.  With all of that said, our commitment to backwards compatibility is as strong as ever.  This new theme engine is actually only activated if we think it <em>can be</em> activated.  That means if you have any template files from the old (1.0) theme engine in your theme folder, it won&#8217;t activate.  If you have any plugins (including Gold Cart) active that hook into the old theme engine, it won&#8217;t activate.  If you don&#8217;t have permalinks enabled, it won&#8217;t activate.</p>\n<p>To be abundantly clear, this is the <em>biggest change </em>we have made to WP eCommerce in at least five years.  We need <strong>a lot </strong>of help testing this out.</p>\n<h2>PayPal Gateways</h2>\n<p>We&#8217;re delighted to announce the inclusion of more PayPal gateways than ever before.  With the launch of 4.0, we now include the Digital Goods API, an updated version of Express Checkout, and for the first time ever, PayPal Pro Hosted.  With the addition of each of these new gateways, our users have more ways than ever before to accept PayPal on their websites.  Please, if you use PayPal, be sure to test any of these and give us feedback.</p>\n<h2>Amazon Payments Gateway</h2>\n<p>For the first time in a <em>long time</em>, we&#8217;ve cleared another payment gateway vendor for inclusion in our core platform. We don&#8217;t make these decisions lightly &#8211; our highest priority is always ensuring that we&#8217;re creating as much value as possible for our users &#8211; so that in turn, they can take care of their customers.  With Amazon, we&#8217;ve found the right candidate to make sure that all of these things can happen.  Amazon is nearly synonymous with global eCommerce and there is nary a more trusted name in commerce.  By accepting Amazon Payments on your website, you decrease friction in the checkout process for your customers (who, in all likelihood, already have their shipping and billing information in their Amazon account). By decreasing friction in the checkout process, you increase conversions.  It&#8217;s a win-win for everyone!</p>\n<h2>Updated Checkout Form Data API</h2>\n<p>We&#8217;ve updated our Checkout Form Data (<code>WPSC_Checkout_Form_Data</code>) API.  For a long time, we&#8217;ve had this API in place to allow developers to access the submitted checkout form data for a particular order.  While this is really great and helpful, we had no way to <em>update</em> that information &#8211; which was pretty lame.  Now, we do.  By simply using very familiar conventions like <code>$form_data-&gt;set( \'billingfirstname\', \'John\' )-&gt;save();</code>, developers can update information dynamically.</p>\n<h2>Updated Purchase Log API</h2>\n<p>Our purchase log API (<code>WPSC_Purchase_Log</code>) is a really helpful API for accessing order information.  It&#8217;s very mature, uses object caching, has filters and actions galore.  However, setting and getting purchase meta hasn&#8217;t been the most elegant thing in the world to do.  Now, it&#8217;s as simple as <code>$log-&gt;set( \'random_meta_key\', $random_meta_value )</code>.  Taking cues from <code>WP_Post</code>, setting and getting keys that don&#8217;t exist in the database table for purchase logs will automatically fall back to the meta table.  This should make developer&#8217;s lives easier when it comes to building integrations that touch purchase logs, allowing for more elegant, object-oriented code.</p>\n<h2>Known Issues</h2>\n<p>Though we&#8217;re in the &#8216;beta 1&#8217; phase, that doesn&#8217;t mean we&#8217;re quite ready for release.  There are a number of <a href=\"https://github.com/WP-e-Commerce/WP-e-Commerce/issues?q=is%3Aopen+is%3Aissue+milestone%3A4.0\">known issues</a> at this time, but none that we consider as blockers for the first beta.  As always, take a look at the issues before reporting a bug.  Be sure to test on a staging site, not on production.  And always, always, <a href=\"http://ithemes.com/member/go.php?r=45982&amp;i=l44\">always make a backup</a>.</p>\n<p>Lastly, and most importantly &#8211; thank you.  Thank you to all of our users, customers, supporters, developer community, and everyone in between.  You are the reason we keep on innovating, keep on moving, and keep on making a difference.</p>\n<p><a class=\"gocheckout\" href=\"https://github.com/wp-e-commerce/WP-e-Commerce/archive/4.0-beta-1.zip\"><strong>Download WPEC 4.0 Beta 1</strong></a></p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:58:\"https://wpecommerce.org/news/wp-ecommerce-4-0-beta-1/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"6\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:9;a:6:{s:4:\"data\";s:48:\"\n		\n		\n		\n		\n		\n				\n		\n		\n\n		\n		\n				\n			\n		\n		\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:18:\"WP eCommerce 3.9.4\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:48:\"https://wpecommerce.org/news/wp-ecommerce-3-9-4/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:57:\"https://wpecommerce.org/news/wp-ecommerce-3-9-4/#comments\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 11 Jun 2015 03:37:41 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:3:{i:0;a:5:{s:4:\"data\";s:15:\"GetShopped News\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:4:\"News\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:2;a:5:{s:4:\"data\";s:19:\"WP eCommerce Plugin\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:33:\"https://wpecommerce.org/?p=479726\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:384:\"Today, we released WP eCommerce 3.9.4.  This is a security and maintenance release.  As such, we highly recommend updating your sites.  From our changelog, this release includes the following fixes: Security Fix: Harden several instances...</p><p class=\"continue-reading\"><a class=\"more-link\" href=\"https://wpecommerce.org/news/wp-ecommerce-3-9-4/\">Continue reading &#8594;</a></p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Justin Sainton\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:1836:\"<p>Today, we released WP eCommerce 3.9.4.  This is a security and maintenance release.  As such, we highly recommend updating your sites.  From our changelog, this release includes the following fixes:</p>\n<ul>\n<li>Security Fix: Harden several instances of $_POST input that were not sanitized properly. Specifically, PayPal settings and Quick Edit fields for products.</li>\n<li>Security Fix: Do not return visitor meta if WP eCommerce presumes a user to be a bot.</li>\n<li>Enhancement: Provide a notice for users to repair their WP eCommerce tables if visitor and visitor meta tables are in need of repair. See <a href=\"https://github.com/wp-e-commerce/WP-e-Commerce/issues/1901\">#1901</a>.</li>\n<li>Fix: Notices on stats saving for products.</li>\n</ul>\n<p>The primary fix here was due to a circumstance whereby user data could be exposed unintentionally.  If your visitor tables somehow became corrupted, our visitor meta API would think that all users were bots. As such, it would save user meta from humans (which, by the way, are not bots) to the same ID.  This would cause exposure of data from one human to another.  This is less than ideal.</p>\n<p>As part of this update, we&#8217;ve added a routine to check if the tables are corrupt and in need of repair.  If so, you should see a notice in your admin dashboard.  However, if that doesn&#8217;t show up for any reason, you can define the WP_ALLOW_REPAIR constant in your wp-config.php file &#8211; or add &#8220;add_filter( &#8216;wpsc_tables_need_repair&#8217;, &#8216;__return_true&#8217; );&#8221; to your functions.php file in your theme.</p>\n<p>Please <a href=\"https://wordpress.org/plugins/wp-e-commerce/\">update today</a> <img src=\"https://s.w.org/images/core/emoji/2.3/72x72/1f642.png\" alt=\"🙂\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" /></p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:53:\"https://wpecommerce.org/news/wp-ecommerce-3-9-4/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"8\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}}}s:27:\"http://www.w3.org/2005/Atom\";a:1:{s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:0:\"\";s:7:\"attribs\";a:1:{s:0:\"\";a:3:{s:4:\"href\";s:48:\"https://wpecommerce.org/feed/?category_name=news\";s:3:\"rel\";s:4:\"self\";s:4:\"type\";s:19:\"application/rss+xml\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:44:\"http://purl.org/rss/1.0/modules/syndication/\";a:2:{s:12:\"updatePeriod\";a:1:{i:0;a:5:{s:4:\"data\";s:6:\"hourly\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:15:\"updateFrequency\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"1\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}}}}}}}}s:4:\"type\";i:128;s:7:\"headers\";O:42:\"Requests_Utility_CaseInsensitiveDictionary\":1:{s:7:\"\0*\0data\";a:15:{s:6:\"server\";s:5:\"nginx\";s:4:\"date\";s:29:\"Mon, 03 Jul 2017 02:25:22 GMT\";s:12:\"content-type\";s:34:\"application/rss+xml; charset=UTF-8\";s:14:\"content-length\";s:5:\"10016\";s:7:\"expires\";s:29:\"Thu, 19 Nov 1981 08:52:00 GMT\";s:13:\"cache-control\";s:35:\"no-store, no-cache, must-revalidate\";s:6:\"pragma\";s:8:\"no-cache\";s:4:\"link\";s:60:\"<https://wpecommerce.org/wp-json/>; rel=\"https://api.w.org/\"\";s:10:\"set-cookie\";s:44:\"PHPSESSID=686dj9