(960, 168, 'introduction', '<div style=\"text-align:center;\">ベトナムハノイ市の旧市街に佇む「安南パーラー」。</div>旧市街でのほっと一息できる場所として、観光などの情報交換ができる場所として、お気軽にお立ち寄りください。ベトナムのデザート「チェー」やドリンクなど、ベトナムに来たら一度は食べてみたい魅力的なメニューをご用意しております。ベトナムのパン「バインミー」を使い、ベトナムならではの材料を使って作られた「安南ラスク」や伝統工芸村とコラボレートして作ったオリジナル商品など、ここでしか手に入らない逸品を取り揃えております。'),
